import React, { Fragment, useContext } from 'react';
import { Link } from 'react-router-dom';
import AuthContext from '../../../context/auth/AuthContext';
import PropTypes from 'prop-types';
import M from 'materialize-css/dist/js/materialize.min.js';
import DropDownMenu from '../../Layout/DropdownMenu/DropdownMenu.js';
import './Navbar.css';


const Navbar = (props) => {
    const authContext = useContext(AuthContext);
    const { isAuthenticated, logout, user } = authContext;

    useEffect(() => {
        M.AutoInit();
        //eslint-disable-next-line
      }, []);

    const onLogout = () => {
        logout();
    };

    const authLinks = (
        <div className="right">
            <li className="tom">Hello {user && user.name}</li>
            <li>
                <a onClick={onLogout} href='#!'>
                    <span>Logout</span>
                </a>
            </li>
        </div>
    );

    const guestLinks = (
        <Fragment>
            <div className="right">
                <li>
                    <Link to='/register'>Register</Link>
                </li>
                <li>
                    <Link to='/login'>Login</Link>
                </li>
            </div>
        </Fragment>
    );

    return (
        <div>
            <nav className="nav-wrapper blue lighten-1 ">
                <div></div>
                <div>
                    <a href="#!" className="brand-logo center"> {isAuthenticated ? "Dashboard" : props.appName} </a>
                </div>
                <div>
                    <DropDownMenu>
                    <ul>{isAuthenticated ? authLinks : guestLinks}</ul>
                    </DropDownMenu>
                </div>
            </nav>
        </div>

    )
}
Navbar.propTypes = {
    appName: PropTypes.string.isRequired

};

Navbar.defaultProps = {
    appName: 'TimeCardApp'
};

export default Navbar;
